Описание:
Арт. 108537492 Участок расположен на въезде в город Чехов со стороны Москвы, рядом с шоколадной фабрикой BARRY CALLEBAUT и строящейся фабрикой по выпуску сокосодержащих напитков. Территория находится прямо на  Старом Симферопольском шоссе напротив м-на Губернский. Ориентировочно в 46 км от МКАД.
Кадастровый номер земельного участка 50:31:0020301:295 общей площадью 23 700 кв.м. со статусом - земли населенных пунктов - для размещения объектов ДЕЛОВОГО назначения, в том числе ОФИСНЫХ ЦЕНТРОВ.
Юридический адрес участка: Московская область, Чеховский район, г. Чехов, Уездная, владение 19.

Границы участка:
на северо-востоке: земли поселений (земли населенных пунктов);
на юго-востоке: примыкает дорога магистрального значения Старое Симферопольское шоссе;
на юго-западе: примыкает дорога Чехов-Скурыгино IV категории;
на северо-западе: участок для размещения подъездных путей и земли промышленности, энергетики, транспорта, связи, радиовещания, телевидения, информатики, земли для обеспечения косм ..., 13 фото
